import React, {Component} from 'react';
import styled from 'styled-components';

class Controls extends Component{
  render(){
    console.log("controls")
    return(
      <div>
        <ul>

          <li>
            <Button
              onClick={function(e){
                e.preventDefault();
                this.props.getControls(1);
              }.bind(this)}
              >Write
            </Button>
          </li>
        </ul>
      </div>
    )
  }
}

const Button = styled.button`
  width: 10em;
  height: 5em;
  padding: 1em 2em;
  background: #eeeeee;
  &:hover{
    background: #0000ee;
  }
`


export default Controls;
